import React from 'react';
import { Reset } from 'styled-reset';
import styled, { createGlobalStyle } from 'styled-components';
import Header from './Header';

export default function RootLayout() {
    return (
        <div>
            <Reset />
            <GlobalStyles />
            <Header />
            <QuestionsPage />
            <AskPage />
        </div>
    )
}
